import "./endpage.sass"
import { Box } from "@mui/material"

function Endpage() {
    return (
        <Box className = "endpage" height = "200px">
            <h1>Contact</h1>
            <h2>Phone: (714)552-9300<br></br>Email: taylornguyen904@gmail.com</h2>
        </Box>
    )
}
export default Endpage;
